INSERT INTO `apps_category` VALUES (1,4,'BizzzWizzz','bizzzwizzz.png','bizzzwizzz_graphic.png','Get reports of your earning, team details and raise request on bizzzwizzz helpdesk in case of any issue. Update your personal and business information, Book and cancel your slot for consultancy.','2017-02-18 16:09:25','https://goo.gl/FYAq7V','BizzzWizzz'),(2,3,'Sarvodaya Hospital','sarvodaya.png','sarvodaya_grahic.png','\nSarvodaya Hospital, a multi-specialty tertiary hospital, is amongst the finest medical destinations in Faridabad. Spread across 4.25 acres, the hospital has 300 Beds, 65 ICU Beds, 6 Operation Theaters, 128 sliced CT scan, 1.5 Tesla MRI and floor based Cath Lab.','2017-02-18 16:09:25','https://goo.gl/3GBreK','SarvodayaHospital'),(3,2,'Lelo sab kuch saste mein','shopping.png','shopping_graphic.png','Shopping for groceries and household essentials is now even easier with Grofers. Shop on the go and get groceries, fresh fruits & vegetables, cakes & other bakery items, meats & seafood, cosmetics, mobiles & accessories, electronics and baby care products. We get it all delivered at your doorstep within hours. You can also schedule deliveries at a time of your choice.','2017-02-20 13:13:00','https://goo.gl/u3ru8p','Shoping'),(4,6,'Sports Buddy','sbuddy.png','sbuddy_graphic.png','Search Sports Partners, Coaches & Sports Venues in and around your locality to play your favourite sports.Explore Sports Events happening in your city.','2017-02-20 13:15:09','https://goo.gl/gQ5tcJ','SBuddy'),(5,5,'School App','st_andrews.png','st_andrews_graphic.png','Designed with an objective to bridge the gap between school and parents in order to provide a one stop shop for parents and school staff to gather all important information  on a finger tip.','2017-02-20 13:18:04','','School'),(12,1,'UltraGST','ultragst_app.png','ultragst_graphic.png','UltraGST is a Free GST billing App that lets a business owner keep track of his sale and purchases and can manage stock corresponding to products, Owner can also manage his creditors and debtors at the time of purchase and sale. UltraGST allows you to purchase and sale products through barcode. It makes your business easy to control and manage.','2017-02-20 13:18:04','https://goo.gl/uiL4f1','UltraGST');
